  public int smallestDistancePair(int[] nums, int k) {
    Map<Integer, Integer> count = new HashMap<>();
    Map<Integer, Integer> diffs = new HashMap<>();
    for (int num : nums) {
      count.put(num, count.getOrDefault(num, 0) + 1);
    }
    for (Map.Entry<Integer, Integer> i : count.entrySet()) {
      if (i.getValue() > 1) {
        diffs.put(0, diffs.getOrDefault(0, 0) + i.getValue());
      }
      for (Map.Entry<Integer, Integer> j : count.entrySet()) {
        if (i == j) {
          continue;
        }
        int diff = Math.abs(i.getKey() - j.getKey());
        diffs.put(diff, diffs.getOrDefault(diff, 0) + i.getValue() * j.getValue());
      }
    }
    PriorityQueue<Map.Entry<Integer, Integer>> queue = new PriorityQueue<>(((o1, o2) -> o1.getKey() - o2.getKey()));
    queue.addAll(diffs.entrySet());
    int last = -1;
    int sum = 0;
    while (sum < k) {
      last = queue.peek().getKey();
      sum += queue.poll().getValue();
    }
    return last;
  }
